import Icon1 from "../Icons/Icon1.png";
const Navigation = () => {

    return(
        <>
        <div className="navBar">
        <ul>
                <li><a href="/"> <img className='Icon1' src ={Icon1 }></img></a></li>
                <li><a href="/Patients">Patients</a></li>
                <li><a href="/Doctors">Doctors</a></li>
            </ul>
        </div>
        </>
    )
}
export default Navigation
